import "./worklist.scss";
import Works from "../works/Works";
import { work } from "../../data";

const Worklist = () => {
  return (
    <div className="container">
       <div className="wl">
        <div className="wl-texts">
            <h1 className="wl-title">Projects</h1>
            <p className="wl-desc">
            Here are some previous projects i've done with different technical frameworks and tools, such as React, JavaScript, Flexbox and Grid. 
            </p>
        </div>
        <div className="wl-list">
          {work.map((item) => (
            <Works key={item.id} img={item.img} link={item.link} title={item.title} text={item.text}/>
          ))}
        </div>
      </div>
    </div>

  );
};


export default Worklist;
